	@Override
	public void onBlockPlacedBy(World world, int x, int y, int z, EntityLivingBase entity, ItemStack itemStack) {
		//if (world.isRemote) return;
		int l = MathHelper.floor_double((double) (entity.rotationYaw * 4.0F / 360.0F) + 0.5D) & 3;
		System.out.println(l);
		if (l==0) {
			world.setBlockMetadataWithNotify(x, y, z, 2, 2);
			createFrameSouth(world, x, y, z);
		}
		else if (l==1) {
			world.setBlockMetadataWithNotify(x, y, z, 3, 2);
			createFrameWest(world, x, y, z);
		}
		else if (l==2) {
			world.setBlockMetadataWithNotify(x, y, z, 4, 2);
			createFrameNorth(world, x, y, z);
		}
		else if (l==3) {
			world.setBlockMetadataWithNotify(x, y, z, 5, 2);
			createFrameEast(world, x, y, z);
		}
			
		
		if (itemStack.hasDisplayName()) {
			((TileEntityFurnace) world.getTileEntity(x, y, z)).func_145951_a(itemStack.getDisplayName());
		}
	}

	@Override
	public void breakBlock(World world, int x, int y, int z, Block blockOld, int metadataOld) {
		switch (metadataOld) {
			case 2:
				removeFrameSouth(world, x, y ,z);
			case 3:
				removeFrameWest(world, x, y ,z);
			case 4:
				removeFrameNorth(world, x, y ,z);
			case 5:
				removeFrameEast(world, x, y ,z);
		}
	}

